INSERT INTO `comments` VALUES (1,'您好:\r\n\r\n请将您在币安交易所的以太币提现到您在Pickcoin交易充值地址,\r\n以太币充值页面如下:\r\nhttps://pickcoinex.com/funds#/deposits/eth\r\n\r\n谢谢您的提问,\r\n有任何问题请再联系线上客服,\r\n\r\nPICKCOIN交易所\r\n客服编号12035(方颖)',5,3,'2018-07-04 05:34:28','2018-07-04 05:34:28'),(2,'您好:\r\n只要将以太币或比特币充值到Pickcoin交易所,\r\n就可以直接依现价兑换成GICT及其他币种,\r\n谢谢您的提问,\r\n有任何问题请再联系线上客服,\r\nPICKCOIN交易所 客服编号12035(方颖)',5,4,'2018-07-09 16:11:11','2018-07-09 16:11:11'),(3,'您好:\r\n是的,\r\n所以数字资产转出都是用提现功能申请的,\r\n谢谢您的提问,\r\n有任何问题请再联系线上客服, \r\n\r\nPICKCOIN交易所 客服编号12035(方颖)',5,6,'2018-07-11 14:18:24','2018-07-11 14:18:24'),(4,'您好:\r\n\r\n抱歉,\r\n我们所有的提现都无法备注讯息,\r\n都是审核后由节点服务器自动发币的,\r\n谢谢您的提问,\r\n有任何问题请再联系线上客服,\r\n\r\nPICKCOIN交易所 客服编号12035(方颖)',5,7,'2018-07-11 14:20:17','2018-07-11 14:20:17'),(5,'您好:\r\n您下单的买单若低于目前交易所中的挂单，\r\n或是相同金额下您出价的时间较晚，\r\n而卖出的人数量有限，\r\n则您所挂出的买单就不会成交，\r\n\r\n\r\n谢谢您的提问,\r\n有任何问题请再联系线上客服,\r\nPICKCOIN交易所\r\n客服编号12038(陈缤)',5,9,'2018-07-12 16:39:41','2018-07-12 16:39:41'),(6,'好:\r\n\r\n抱歉我们不清楚Maicoin钱包是什么?\r\n我们这里没有这个钱包可以下载,\r\n所以无法回答您Maicoin钱包的使用方式,\r\n但是只要接收方是以太坊地址皆可收发以太币,\r\n谢谢您的提问,\r\n有任何问题请再联系线上客服,\r\n\r\nPICKCOIN交易所 客服编号12035(方颖)',5,13,'2018-07-16 10:59:44','2018-07-16 10:59:44'),(7,'您好:\r\n\r\n您的Google的两步验证已经帮您取消,\r\n但这是因为上币客户委托担保才破例,\r\n一般只要Google两步验证遗失,\r\n您必须上传相关证件及重新电邮认证审查后才能开通,\r\n请务须保管好您的Google两步验证,\r\n否则此一验证程序便形同虚设,\r\n您的数位资产安全保护便荡然无存.\r\n\r\n谢谢您的提问,\r\n有任何问题请再联系线上客服,\r\n\r\nPICKCOIN交易所 客服编号12035(方颖)',5,11,'2018-07-16 11:05:22','2018-07-16 11:05:22'),(8,'您好:\r\n完成处理的工单我们就会标注已处理,\r\n工单会被归类备档在已处理工单中,\r\n这只是正常程序,\r\n\r\n谢谢您的提问,\r\n有任何问题请再联系线上客服,\r\nPICKCOIN交易所\r\n\r\n客服编号12035(方颖)',5,14,'2018-07-16 13:23:27','2018-07-16 13:23:27'),(9,'您好: \r\n您的Google的两步验证已经帮您取消, \r\n但这是因为上币客户委托担保才破例, \r\n一般只要Google两步验证遗失, \r\n您必须上传相关证件及重新电邮认证审查后才能开通, \r\n请务须保管好您的Google两步验证, \r\n否则此一验证程序便形同虚设, \r\n您的数位资产安全保护便荡然无存. \r\n\r\n谢谢您的提问, \r\n有任何问题请再联系线上客服, \r\n\r\nPICKCOIN交易所 \r\n客服编号12035(方颖)',5,15,'2018-07-17 00:58:01','2018-07-17 00:58:01'),(10,'您好:\r\n\r\n抱歉我们无法提供图文教学,\r\nPickcoin交易所的功能已经尽量简化了,\r\n\r\n(1)小伙伴只需要将您的酷红币GICT\r\n转到您交易所充值的地址.\r\n\r\n(2)等待以太坊网路的交易验证后(约120~150个区块),\r\n您的币就会打进交易所帐户.\r\n\r\n(3)在GICT/ETH交易对,或GICT/BTC交易所将您的币售出,\r\n即可获得相对应市价的BTC或ETH.\r\n\r\n(4)将BTC或ETH提现即完成.\r\n\r\n谢谢您的提问,\r\n有任何问题请再联系线上客服,\r\n\r\nPICKCOIN交易所 客服编号12035(方颖)',5,17,'2018-07-25 14:05:50','2018-07-25 14:05:50'),(11,'您好\r\n最近以太坊网路拥堵,\r\n今天伺服器做了点小备份,\r\n可能会有读取困难的错误,\r\n但是我们已经处理完毕,\r\n现在应该已经恢复正常了,\r\n谢谢您的反应,\r\n有任何问题请再联系线上客服,\r\nPICKCOIN交易所\r\n\r\n技术客服\r\n编号12008(陈小舟)',5,18,'2018-07-27 06:17:02','2018-07-27 06:17:02'),(12,' PICKCOIN交易所客服編號12035(方穎)我已經轉4000酷紅幣到這個地址3M9DgYDWmyGvahy7G15drNruhQdyp3QYw9  但是我一直沒有收到轉入通知還有你面還是00000要多久呢麻煩幫我處理一下泄瀉',49,17,'2018-07-27 11:25:34','2018-07-27 11:25:34'),(13,'您好\r\n\r\n3M9DgYDWmyGvahy7G15drNruhQdyp3QYw9\r\n是比特幣的地址\r\n如果您充值到比特幣地址是不會轉出成功的\r\n您可以上https://etherscan.io/\r\n右上方輸入查詢您的錢包地址\r\n\r\n\r\n酷紅幣是TOKEN代幣\r\n有自己的以太坊地址\r\n路徑為下:\r\nhttps://pickcoinex.com/funds#/deposits/gict\r\n充值後很快就會到帳了\r\n\r\n謝謝您的提問,\r\n有任何問題請再聯繫線上客服,\r\n\r\nPICKCOIN交易所\r\n客服編號12035(方穎)',5,17,'2018-07-31 08:24:40','2018-07-31 08:24:40'),(14,'您好:\r\n\r\n两部验证是本交易所安全认证的最后防线,\r\n如果您的手机GOOGLE 2FA遗失\r\n我们无法再给您两步验证金钥\r\n因为金钥是您的手机产生的\r\n\r\n万一您的两步验证帐号或手机遗失\r\n而仍未充值任何资产进PickcoinEX交易所\r\n请您使用其他电邮\r\n申请新的交易所帐号\r\n\r\n谢谢您的反应,\r\n有任何问题请再联系线上客服,\r\nPICKCOIN交易所\r\n技术客服\r\n编号12008(陈小舟)',5,19,'2018-07-31 08:31:51','2018-07-31 08:31:51'),(15,'您好:\r\n近日因为以太坊拥堵,\r\n交易所提现预设的Gas Limit及Gas Price不足以让交易打包,\r\n造成提现困难,\r\n我们已经暂时调整Gas,\r\n并让交易完成.\r\n\r\n谢谢您的反应,\r\n有任何问题请再联系线上客服,\r\nPICKCOIN交易所\r\n技术客服\r\n编号12008(陈小舟)',5,20,'2018-08-11 15:35:40','2018-08-11 15:35:40'),(16,'您好: \r\nCTWD是COSHA-TWD的简称,\r\n由新加坡离岸避险中心所开发的稳定币,\r\n并且锚定台币1:1,\r\n并非Crypto The Wonderdog,\r\n\r\n有任何问题请再联系线上客服,\r\nPICKCOIN交易所\r\n技术客服\r\n编号12008(陈小舟)',5,23,'2018-08-28 14:15:49','2018-08-28 14:15:49'),(17,'您好:\r\n您充值的GICT是被注记违规取得的旧币,\r\n目前是失效无法流通的,\r\n您因违反本交易所规定,\r\n会员帐号也会比取消,\r\n\r\n有任何问题请再联系线上客服,\r\nPICKCOIN交易所\r\n技术客服\r\n编号12008(陈小舟)\r\n\r\n\r\n\r\nHello: \r\nYour deposited GICT are invalid tokens and cannot be use.\r\nYou violated the provisions of Pickcoin Exchange,\r\nMember accounts will be canceled.\r\n\r\nIf you have any questions,\r\nplease contact online customer service.\r\n\r\nPICKCOIN Exchange\r\nTechnical customer service\r\nNo. 12008 (Chen Xiaozhou)',5,24,'2018-09-01 07:25:35','2018-09-01 07:25:35'),(18,'How is that possible for invalid ?\r\nwho can i ask about this case ?\r\nand my token just disappeared and will not refund to my ImToken account ?',225,24,'2018-09-01 07:34:27','2018-09-01 07:34:27'),(19,'您好:\r\n若欲取回失效的旧币,\r\n请充值0.005ETH作为转出手续费.\r\n\r\n有任何问题请再联系线上客服,\r\nPICKCOIN交易所\r\n技术客服\r\n编号12008(陈小舟)\r\n\r\n\r\nHello: \r\nIf you want to  refund the old invalid tokens,\r\nPlease deposit 0.005ETH as transfer fee.\r\n\r\nIf you have any questions,\r\nplease contact online customer service.\r\n\r\nPICKCOIN Exchange\r\nTechnical customer service\r\nNo. 12008 (Chen Xiaozhou)',5,24,'2018-09-01 07:44:09','2018-09-01 07:44:09'),(20,'您好:\r\n您充值的GICT是失效的旧版货币,\r\n目前已经全面停止流通,\r\n并且您的持币地址已经发行单位注记为违规地址,\r\n若您持续将旧版GICT任意转出流通,\r\n将会遭受发行单位刑事追偿责任.\r\n\r\n有任何问题请再联系线上客服,\r\nPICKCOIN交易所\r\n技术客服\r\n编号12008(陈小舟)',5,24,'2018-09-01 07:47:59','2018-09-01 07:47:59'),(21,'i have deposit 0.005ETH for transfer fee, i need to refund the invalid tokens to replace the new valid tokens\r\nplease kindly check and confirm\r\nhttps://etherscan.io/tx/0x70d9d91cbb2f9dcc171d170fa0ae7053800e35abee5ecb5b5af0ea3c8da2ad45\r\nThanks !',225,24,'2018-09-02 07:39:22','2018-09-02 07:39:22'),(22,'200,000 old version GICThave been refund.\r\nhttps://etherscan.io/tx/0xf556552f8808b72cbf71edd8926b656892ca8e9b2ed9fa8625957e7e2f56aa56\r\n\r\n\r\n\r\n\r\n\r\n',5,24,'2018-09-03 03:54:57','2018-09-03 03:54:57');
